import React from 'react';

const MisDirecciones = () => {
  return (
    <div className="p-6">
      <h2 className="text-xl font-bold mb-4">Mis Direcciones</h2>
      <ul className="space-y-4">
        <li className="bg-white p-4 rounded shadow">Casa - Av. Siempre Viva 123</li>
        <li className="bg-white p-4 rounded shadow">Trabajo - Calle Ficticia 456</li>
      </ul>
    </div>
  );
};

export default MisDirecciones;
